import React from 'react';
import logo from './logo.svg';
import './App.css';

class Square extends React.Component {
  render() {
    return (
      <button className="square" onClick="myfunction()">
        {/* TODO */}
      </button>
    );
  }
}

myfunction()
{
  alert("Hello");
}

function CustomRendererForGrids() {
  let x = []
  for(let i = 0; i < 10; i++) {
    x.push(<Square />);
  }
  return (<div>{x}</div>);
}

function Prototype() {
  let x = []
  for(let i = 0; i < 2; i++) {
    x.push(<article><CustomRendererForGrids /></article>);
  }
  //alert("Hello");
  return (<div>{x}</div>);
}

function App() {
  return (
    <div className="App">
      <Prototype />
    </div>
  );
}

export default App;
